import React from 'react';
import ContactMeForm from '../contactMeForm/ContactMeForm';

const Contact = ({id}) => {
    return(
            <div className = 'vh-100 w-75 center mt5 shadow-2' id = {id}>
            <div className = ''>
                <h1 className = 'tc pt5 fw5'>Contact Me</h1>
                <div className = 'flex'>
                    <ContactMeForm />
                </div>
            </div>
            <footer className = 'pt2'>Made By Colton Williams</footer>
            </div>
 );
}

export default Contact;
